  false,\n\t\"url\": null,\n\t\"notes\": \"Recent developments in digital terrain
  and geospatial database management technology make it possible to protect this investment
  for existing and future projects to a much greater extent than was possible in the
  past. The Floodplain Mapping/Redelineation study deliverables depict and quantify
  the flood risks for the study area. The primary risk classifications used are the
  0.2-percent-annual- chance flood event, and areas of minimal flood risk. The Floodplain
  Mapping/Redelineation flood risk boundaries are derived from the engineering information
  in the Flood Insurance Studies (FISs), previously published Flood Insurance Rate
  Maps (FIRMs), flood hazard analyses performed in support of the FISs and FIRMs,
  Flood Boundary and Floodway Maps, and new mapping data, where available. The FISs
  and FIRMs are published by the Federal Emergency Management Agency (FEMA).\",\n\t\"license_title\":
